import React from "react";
import "./index.css"

const SubCom = () =>{
    return(
        <>
        <div className="subcomp">
            <form>
            <input type="text" placeholder="Title" />
            <textarea rows="" column="" placeholder="Write a note..." />
            <button className="btn_style">
                
            </button>
            </form>
        </div>

        </>
    )
}

export default SubCom;
